    if (newStudents instanceof Array) {
      newStudents.forEach((i) => {
        if (!(typeof i === 'string')) {
          throw new TypeError('Student name must be a string');
        }
      });
      this._students = newStudents;
    } else {
      throw new TypeError('Students must be an array');
    }
  }
}

